            <h2>
              Full-stack product designer with front-end
              skills, HTML, CSS, JavaScript,React, and React Native. 
           </h2>
            {/* <button>Contact</button> */}
          </div>
        </div>

        <CardSection />

        <SmCardSection />

        {/* Footer */}

      </div>
    );
  }
}

export default Home;
